import React, { Component } from "react";
import LeadCards from "./LeadCards";
import Select from "react-select";
import "./index.scss";

class LandingPage extends Component {
  state = {
    colourStyles: {
      control: styles => ({
        ...styles,
        width: "100%",
        cursor: this.props.disable ? "not-allowed" : "pointer"
      }),
      option: styles => ({ ...styles, width: "100%" }),
      menu: styles => ({ ...styles, width: "100%", zIndex: 1000 }),
      input: styles => ({ ...styles, width: "100%" })
    },
    cityOptions: [{ label: "as", value: "as" }]
  };
  render() {
    return (
      <div className="landing-container">
        <div className="search-block">
          <Select
            className="basic-single"
            isDisabled={false}
            placeholder={"City"}
            isClearable={true}
            styles={this.state.colourStyles}
            isSearchable={true}
            name="color"
            options={this.state.cityOptions}
          />
          <Select
            className="basic-single"
            isDisabled={false}
            placeholder={"City"}
            isClearable={true}
            styles={this.state.colourStyles}
            isSearchable={true}
            name="color"
            options={this.state.cityOptions}
          />
        </div>
        <LeadCards />
        <LeadCards />
        <LeadCards />
      </div>
    );
  }
}

export default LandingPage;
